% call me updated



% set up UDP messaging socket
localIP = '192.168.1.4';
remoteIP = '192.168.1.6';
port = 6665;
socketTag = matlabUDP('open',localIP,remoteIP,port);

% demo code for showing 50 animated targets

% The message calls here are like those in demoUDPDots.m.  There are three
% practical differences:

% 1. This demo uses the dXtext class, which has the following properties:

    % % name              type		values	default
    % 'string',           'string',   [],     '';       ... % text to show
    % 'x',                'scalar',	  [],	  0;		... % pos vis. deg.
    % 'y',                'scalar',	  [],	  0;		... % pos vis. deg.
    % 'size',             'scalar',   [],     60;       ... % size in pts
    % 'font',             'string',   [],     'Courier';... % in points?
    % 'bold',             'boolean',  [],     false;    ... % styles...
    % 'italic',           'boolean',  [],     false;    ...
    % 'underline',        'boolean',  [],     false;    ...
    % 'outline',          'boolean',  [],     false;    ...
    % 'CLUTIndex',        'CLUTi',    [],     4;        ... % color index, 1-256
    % 'visible',          'boolean',  [],     true;     ... % show or not

% 2. This demo uses the sendMsgH--with an H--function for UDP
    % communication.  In high UDP traffic situations like this animation,
    % sendMsgH prevents communications logjams.  If you find you need to
    % send a lot of messages quickly, then let's talk about how you can
    % implement something like sendMsgH.

% 3. This demo uses the dXtargets--with an s--class.  I recommend you stick
    % with dXtarget--without an s.  They have the same functionality but
    % potentially confusing syntax differences.

% Ben

% show a little text
sendMsg('rAdd(''dXtext'',1,1,0,0,''x'',-10.00,''y'',5.00,''CLUTIndex'',2.00,''string'',''Testing Targets...'');');
sendMsgH('rSet(''dXtext'',[1 ],''visible'',true);');
sendMsgH('draw_flag=1;');

WaitSecs(2);

sendMsgH('rSet(''dXtext'',[1 ],''visible'',false);');
sendMsgH('draw_flag=1;');

